import React from "react";
import Header from "../components/header/Header";
import Articles from "../components/articles/Articles";
import Footer from "../components/footer/Footer";

const Home = () => {
  return (
    <div>
      <Header />
      <Articles />
      <Footer />
    </div>
  );
};

export default Home;
